import numpy as np
import pickle
import os
import cv2
import time
from datetime import datetime

import imutils
from imutils.video import VideoStream
curr_path = os.getcwd()
from PIL import Image
import base64
from io import BytesIO

def recognitionFace():
    # --------------LOAD FACE DETECTION MODEL----------
    proto_path = os.path.join(curr_path, 'model', 'deploy.prototxt')
    model_path = os.path.join(curr_path, 'model', 'res10_300x300_ssd_iter_140000.caffemodel')
    face_detector = cv2.dnn.readNetFromCaffe(prototxt=proto_path, caffeModel=model_path)

    # ------------LOAD FACE RECOGNITION MODEL--------
    recognition_model = os.path.join(curr_path, 'model', 'openface_nn4.small2.v1.t7')
    face_recognizer = cv2.dnn.readNetFromTorch(model=recognition_model)

    recognizer = pickle.loads(open('recognizer.pickle', "rb").read())
    le = pickle.loads(open('le.pickle', "rb").read())
    ROOT_DIR = os.path.dirname(os.path.abspath(__file__))

    # ---------USING VIDEO---------------
    # vs = VideoStream(src=0).start()
    # time.sleep(1)

    imagePath = "data:image/jpeg;base64,"
    new_encoded_data = imagePath[imagePath.index(",")+1:]
    decoded_data = base64.b64decode((new_encoded_data))
    img = Image.open(BytesIO(decoded_data))
    out_jpg = img.convert("RGB")
    file_recognition_name = '{}.jpg'.format(str(datetime.now())[:-7].replace(":", "-").replace(" ", "-"))
    path_file = str(ROOT_DIR+'/' + file_recognition_name)

    out_jpg.save(path_file)


    # frame = vs.read()
    frame = cv2.imread(path_file)
    frame = imutils.resize(frame, width=600)

    (h, w) = frame.shape[:2]

    image_blob = cv2.dnn.blobFromImage(cv2.resize(frame, (300, 300)), 1.0, (300, 300), (104.0, 177.0, 123.0), False, False)

    face_detector.setInput(image_blob)
    face_detections = face_detector.forward()

    for i in range(0, face_detections.shape[2]):
        confidence = face_detections[0, 0, i, 2]

        if confidence >= 0.5:
            box = face_detections[0, 0, i, 3:7] * np.array([w, h, w, h])
            (startX, startY, endX, endY) = box.astype("int")

            face = frame[startY:endY, startX:endX]

            (fH, fW) = face.shape[:2]

            face_blob = cv2.dnn.blobFromImage(face, 1.0/255, (96, 96), (0, 0, 0), True, False)

            face_recognizer.setInput(face_blob)
            vec = face_recognizer.forward()

            preds = recognizer.predict_proba(vec)[0]
            j = np.argmax(preds)
            name = le.classes_[j]

    os.remove(file_recognition_name)
    return name









